import React  from 'react';
import {Button, Grid} from 'semantic-ui-react'
import FlipMove from 'react-flip-move';

import './TodoItems.css';


const TodoItems = (props) => {

    const createTask = (item) => {
    return (<div className="so">
        <li key={item.key} >
            {item.text}
        </li>
            <Button className="btn-left" color="green" inverted  >Veiw</Button>
            <Button className="btn-left" color="red"  inverted>edit</Button>
            <Button className="btn-left" color="grey" inverted  >delete</Button>
    </div>
    )
    }

return (

        <Grid textAlign="center">
            <ul className="centered">
                <FlipMove duration={250} easing="ease-out">
                    {props.entries && props.entries.map(createTask)}
                </FlipMove>
            </ul>

        </Grid>


    );
}


export default TodoItems;
